import React from 'react';
import '../App.css';
import './ConnectPage.css';

function ConnectPage() {
  return (
    <div className='central'>
        <div className='option'>
          <div className='login'>LOGIN</div>
          <div className='signup'>SIGN-UsP</div>
        </div>
    </div>
  );
}

export default ConnectPage;
